const _hoisted_172 = /*#__PURE__*/_createStaticVNode("<section id=\"sec23\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>17.1.4 Test System Preparation</p><p class=\"font-weight-bold\" data-v-0784a152>17.1.4.1 Acclimatization</p><p data-v-0784a152>After examination for good health and the suitability for the study, the mice were acclimatized for 5 days prior to treatment. During acclimatization animals were observed daily once. Veterinary examination was performed before selecting the animals for the study.</p></div></section><section id=\"sec24\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>17.1.4.2 Animal Identification</p><p data-v-0784a152>During acclimatization period (Temporary identification), each animal was identified by ear marking with animal number written on the ear lobe using marker pen. The cages were identified with cage cards indicating study number, study code, species, strain, sex, acclimatization start and acclimatization end date.</p><p data-v-0784a152>During treatment period (Permanent identification), each animal was identified by body marking using 1 % turmeric solution. The cages were identified with cage cards indicating study number, animal accession number, study code, species, strain, sex, treatment start date and experiment end date.</p></div></section><section id=\"sec25\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>17.1.4.3 Randomization and Grouping</p><p data-v-0784a152>The animals for the experiment were weighed and arranged in ascending order of their body weights. Animals were randomized during acclimatization using body weight stratification method of randomization and are grouped accordingly such that the mean body weight did not vary ± 20 percent among the groups on the Day 1 of administration.</p></div></section><section id=\"sec25\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>17.1.4.3 Randomization and Grouping</p><p data-v-0784a152>The animals for the experiment were weighed and arranged in ascending order of their body weights. Animals were randomized during acclimatization using body weight stratification method of randomization and are grouped accordingly such that the mean body weight did not vary ± 20 percent among the groups on the Day 1 of administration.</p></div></section><section id=\"sec26\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>17.1.4.4 Clipping of Animals</p><p data-v-0784a152>For induction phase, the fur of the animals was closely clipped before 24 hrs before the treatment from shoulder region (an area of 3 cm x 5 cm). For challenge phase, the fur was closely clipped from the required flank region [80 sq cm (8 cm x 10 cm)] 24 hrs before treatment. In both the cases care was taken to avoid abrasion on the skin.</p></div></section>", 5);
