of Non-Polar Extraction Preparation:</b> 2g and 2g of each Test Item (Foam and Tubing Material) and 60cm2 of test item (Thin film) was weighed / taken and transferred to the sterile beaker containing 55 mL of sesame oil. </p><p data-v-0784a152>Similar procedure was followed for polar and non-polar control without adding Test Item.</p><p data-v-0784a152>All the (polar and non-polar test item and polar and non-polar control) were subjected to extraction at 37.0 °C with continuous agitation in orbital shaker incubator at 110 rpm.</p><p data-v-0784a152>Pre and post extraction condition for the appearance of extracts was checked. The final extract was observed for the presence of visual particles. Extraction procedure was carried out under aseptic condition.</p><p data-v-0784a152>Absorption ratio of the Form was determined and found to be in range of 14 mL for 0.9% NaCl and 25 mL for sesame oil.</p><p data-v-0784a152>pH of polar and non-polar test item extracts and control was checked using pH strips and pH was measured between 6-7.</p><p data-v-0784a152>The left over test item and test item extract after administration is stored in a container and send for disposal.</p></div></section><section id=\"sec31\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>17.3.1.2 Extraction Conditions</p><p data-v-0784a152>Vehicle and extraction condition is as depicted below:</p><table class=\"table table-bordered\" data-v-0784a152><thead data-v-0784a152><tr data-v-0784a152><th rowspan=\"2\" data-v-0784a152>Date/phase</th><th rowspan=\"2\" data-v-0784a152>Vehicle</th><th colspan=\"3\" data-v-0784a152>Extraction Temperature (in ºC)</th><th rowspan=\"2\" data-v-0784a152>Total Extraction Time</th><th rowspan=\"2\" data-v-0784a152>Extract appearance</th></tr><tr data-v-0784a152><th data-v-0784a152>Set value</th><th data-v-0784a152>Maximum</th><th data-v-0784a152>Minimum</th></tr></thead><tbody data-v-0784a152><tr data-v-0784a152><td rowspan=\"4\" data-v-0784a152>From XX/XX/2022 to XX/XX/2022 / Intradermal induction phase</td><td data-v-0784a152>Polar Vehicle</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td rowspan=\"4\" data-v-0784a152>XXX</td><td data-v-0784a152>Clear</td></tr><tr data-v-0784a152><td data-v-0784a152>Polar test item extract</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td data-v-0784a152>Clear</td></tr><tr data-v-0784a152><td data-v-0784a152>Non-polar vehicle</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td data-v-0784a152>Clear</td></tr><tr data-v-0784a152><td data-v-0784a152>Non-Polar test item extract</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td data-v-0784a152>Clear</td></tr><tr data-v-0784a152><td rowspan=\"4\" data-v-0784a152>From XX/XX/2022 to XX/XX/2022 / Topical induction phase</td><td data-v-0784a152>Polar Vehicle</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td rowspan=\"4\" data-v-0784a152>XXX</td><td data-v-0784a152>Clear</td></tr><tr data-v-0784a152><td data-v-0784a152>Polar test item extract</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td data-v-0784a152>Clear</td></tr><tr data-v-0784a152><td data-v-0784a152>Non-polar vehicle</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td data-v-0784a152>Clear</td></tr><tr data-v-0784a152><td data-v-0784a152>Non-Polar test item extract</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td data-v-0784a152>Clear</td></tr><tr data-v-0784a152><td rowspan=\"4\" data-v-0784a152>From XX/XX/2022 to XX/XX/2022 / Challenge phase</td><td data-v-0784a152>Polar Vehicle</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td rowspan=\"4\" data-v-0784a152>XXX</td><td data-v-0784a152>Clear</td></tr><tr data-v-0784a152><td data-v-0784a152>Polar test item extract</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td data-v-0784a152>Clear</td></tr><tr data-v-0784a152><td data-v-0784a152>Non-polar vehicle</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td data-v-0784a152>Clear</td></tr><tr data-v-0784a152><td data-v-0784a152>Non-Polar test item extract</td><td data-v-0784a152>37.0</td><td data-v-0784a152>37.1</td><td data-v-0784a152>37.0</td><td data-v-0784a152>Clear</td></tr></tbody></table></div></section><section id=\"sec32\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>17.3.1.3 Intradermal Induction Phase</p><p data-v-0784a152>The animals of test groups (G2a and G2b) and control group (G1a and G1b) were injected with polar and non-polar test item extracts and polar and non-polar vehicle control respectively. The animals were injected at the shoulder region with 0.1 mL per injection of 3 pairs of intradermal injections. Injections 1 and 2 were given near the head region at least 1 cm apart and injections 3 were given 2 cm apart towards caudal part of the body.</p><p data-v-0784a152><b data-v-0784a152>Figure 1:</b> Site of intra-dermal injections in the mice for maximization test of Magnusson and Kligman (Annexure 3).</p><p data-v-0784a152>Site A: 1st pair of injection<br data-v-0784a152>Site B: 2nd pair of injection<br data-v-0784a152>Site C: 3rd pair of injection</p><p class=\"font-weight-bold\" data-v-0784a152>Polar Vehicle Control (G1a)</p><p data-v-0784a152><li data-v-0784a152>Site ‘A’ was injected intradermally with 0.1 mL of 1:1 mixture (v/v) of FCA in Physiological saline.</li><li data-v-0784a152>Site ‘B’ was injected intradermally with 0.1 mL of Polar Vehicle control.</li><li data-v-0784a152>Site ‘C’ was injected intradermally with 0.1 mL of 50% v/v polar Vehicle control in 1:1 mixture (v/v) of FCA in in Physiological saline.</li></p><p class=\"font-weight-bold\" data-v-0784a152>Non-Polar Vehicle Control (G1b)</p><p data-v-0784a152><li data-v-0784a152>Site ‘A’ was injected intradermally with 0.1 mL of 1:1 mixture (v/v) of FCA in Physiological saline </li><li data-v-0784a152>Site ‘B’ was injected intradermally with 0.1 mL of non-polar Vehicle control extract.</li><li data-v-0784a152>Site ‘C’ was injected intradermally with 0.1 mL of 50% v/v non-polar Vehicle control extract in 1:1 mixture (v/v) of FCA in in Physiological saline.</li></p><p class=\"font-weight-bold\" data-v-0784a152>Polar Test Item Extract (G2a)</p><p data-v-0784a152><li data-v-0784a152>Site ‘A’ was injected intradermally with 0.1 mL of 1:1 mixture (v/v) of FCA in Physiological saline</li><li data-v-0784a152>Site ‘B’ was injected intradermally with 0.1 mL of undiluted polar test item extract.</li><li data-v-0784a152>Site ‘C’ was injected intradermally with 0.1 mL of 50% v/v undiluted polar test item extract in 1:1 mixture (v/v) of FCA in in Physiological saline.</li></p><p class=\"font-weight-bold\" data-v-0784a152>Non-Polar Test Item Extract (G2b)</p><p data-v-0784a152><li data-v-0784a152>Site ‘A’ was injected intradermally with 0.1 mL of 1:1 mixture (v/v) of FCA in Physiological saline</li><li data-v-0784a152>Site ‘B’ was injected intradermally with 0.1 mL of undiluted non-polar test item extract.</li><li data-v-0784a152>Site ‘C’ was injected intradermally with 0.1 mL of 50% v/v undiluted Non- polar test item extract in 1:1 mixture (v/v) of FCA in in Physiological saline.</li></p></div></section><section id=\"sec33\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>17.3.1.5 Challenge Phase</p><p data-v-0784a152>After 14 days, completion of the topical induction phase (i.e., Day 21), fur was removed from left and right flank areas using electric clipper.</p><p data-v-0784a152>On day 22, the filter paper (2 cm x 4 cm) was loaded with 0.5mL respective vehicle control and test item extract as below:</p><table class=\"table table-bordered\" data-v-0784a152><tbody data-v-0784a152><tr data-v-0784a152><td rowspan=\"2\" data-v-0784a152>G1a</td><td data-v-0784a152>Anterior Right Flank</td><td data-v-0784a152>Polar Vehicle Control</td></tr><tr data-v-0784a152><td data-v-0784a152>Anterior Left Flank</td><td data-v-0784a152>Undiluted Polar Test Item Extract</td></tr><tr data-v-0784a152><td rowspan=\"2\" data-v-0784a152>G2a</td><td data-v-0784a152>Anterior Right Flank</td><td data-v-0784a152>Polar Vehicle Control</td></tr><tr data-v-0784a152><td data-v-0784a152>Anterior Left Flank</td><td data-v-0784a152>Undiluted Polar Test Item Extract</td></tr><tr data-v-0784a152><td rowspan=\"2\" data-v-0784a152>G1b</td><td data-v-0784a152>Anterior Right Flank</td><td data-v-0784a152>Non-polar Vehicle Control </td></tr><tr data-v-0784a152><td data-v-0784a152>Anterior Left Flank</td><td data-v-0784a152>Undiluted Non-Polar Test Item Extract</td></tr><tr data-v-0784a152><td rowspan=\"2\" data-v-0784a152>G2b</td><td data-v-0784a152>Anterior Right Flank</td><td data-v-0784a152>Non-polar Vehicle Control </td></tr><tr data-v-0784a152><td data-v-0784a152>Anterior Left Flank</td><td data-v-0784a152>Undiluted Non-Polar Test Item Extract</td></tr></tbody></table><p data-v-0784a152>The patches were secured with semi occlusive dressing. Patches were removed after 24 hrs.</p></div></section><section id=\"sec34\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>17.3.1.6 Re-challenge Phase</p><p data-v-0784a152>Re-challenge phase was not done as there was no signs of any irritation were observed during challenge phase.</p></div></section><section id=\"sec35\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>18 OBSERVATIONS</p><p class=\"font-weight-bold\" data-v-0784a152>18.1 Mortality, Morbidity and Clinical Signs</p><p data-v-0784a152>Animals were observed twice daily for mortality, morbidity and once daily for clinical signs throughout the observation period. There were no clinical signs observed, hence the animals were observed once for morbidity and mortality during weekends and holidays.</p></div></section><section id=\"sec38\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>19. RESULTS</p><p class=\"font-weight-bold\" data-v-0784a152>19.1 Mortality , Morbidity and Clinical Signs</p><p data-v-0784a152>Refer to Table 1 Appendix 1.</p><p data-v-0784a152>There were no mortality, Morbidity and clinical signs observed in any of the animals during the study period.</p></div></section><section id=\"sec39\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>19.2 Body Weights</p><p data-v-0784a152>Refer to Table 2 and Appendix 2.</p><p data-v-0784a152>There were no changes in body weight (g) and body weight gain (%) in the test animals when compared to respective Vehicle control during the study period.</p></div></section><section id=\"sec41\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>20. CONCLUSION</p><p data-v-0784a152>Based on the above results, the graded (Magnusson and Kligman grading scale) score was 0.The comparison of the skin reaction (at the challenge phase) of the test item treated animals with those of the Vehicle control group animals show that the test item “XLR8 Foam Dressing Kit Large / XF-DLGF1” is classified as “Non-sensitizer” to mice under the stated experimental condition.</p></div></section><section id=\"sec42\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>21. DATA COMPILATION</p><p data-v-0784a152>All individual animal data were presented in appendices and summarized and presented in tables. All findings were presented in the report.</p></div></section><section id=\"sec43\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>22. ANIMAL EUTHANASIA AND DISPOSAL</p><p data-v-0784a152>At the end of experiment period all the animals were sacrificed using carbon dioxide asphyxiation. The carcasses were stored in deep freezer and disposed of through Medicare Environmental Management Pvt. Ltd.</p></div></section><section id=\"sec44\" class=\"mt-0 pl-5 pr-5 pt-3 pb-3\" data-v-0784a152><div class=\"col-12\" data-v-0784a152><p class=\"font-weight-bold\" data-v-0784a152>23. STUDY REPORT DISTRIBUTION</p><p data-v-0784a152>The Final Study Report will be distributed as follows:<br data-v-0784a152>Copy No. 1/2 – Sponsor<br data-v-0784a152>Copy No. 2/2 – Archives, Liveon Biolabs Private Limited</p></div></section>", 13);
